    [],nt"revision_timestamp": "2015-09-09T19:00:16.487258",nt"name": "naip-2015-imagery-feedback-map",nt"isopen":
    true,nt"url": null,nt"notes": "The NAIP 2015 Imagery Feedback map allows
    users to make comments and observations about the quality of the 2015 National Agriculture
    Imagery Program (NAIP) acquisition. The feedback obtained from this map will be
    reviewed by APFO staff and considered both for the current year imagery and future
    updates. The feedback provided by users will help to improve the NAIP imagery program.
    To provide feedback, Click the "Edit" button on the toolbar, then click a point
    or polygon symbol in the editing template on the left side of the map. Then click
    on the imagery at the location of your observation/feature. To add only a comment
    click the orange pin symbol and type in your comment. You may also add attachments
    to your comments or observations. Click the browse button in the attachments section
    of the editing pop up window and then choose the file from your computer. The file
    may be up to 10MB in size and file types include: DOC, DOCX, GIF, IMG, JP2, JPEG,
    PDF, TXT, XML, and ZIP.",nt"license_title": "Creative Commons Attribution",nt"extras":
